import * as React from 'react'
import { render } from '@testing-library/react'


const createButton = (props: any) => {

    const [showFormState, updateFormState] = React.useState<boolean>(false)

    function showForm(){
        return(
            <form>
                <input
                    placeholder="List Title"
                    type="text"
                />
            </form>
        )
    }

    return(
            <button className="create-list-btn" onClick={updateFormState(true)}>Create List</button>
    )
}

export default createButton
